import React from "react";
import { Container, Col, Row, Badge } from "react-bootstrap";

const viewData = {};
const genreData = {};
const timeData = {};
const popularityData = {};

const Sample = () => {
  return (
    <Container>
      <h1 className="netflix-red">
        Your Netflix Analysis <Badge variant="warning">Example</Badge>
      </h1>
      <Container>
        <h2>Top Views</h2>
        <h2>Top Genre</h2>
        <h2>View Time</h2>
        <h2>Popularity</h2>
      </Container>
    </Container>
  );
};

export default Sample;
